I wrote a simple unit test, and here is its cases and result. Only the IPv4-mapped IPv6 address is converted.

 #include <iostream>
 #include <string>
 #include <vector>
 #include <boost/asio/ip/address.hpp>

 std::string convertIpAddr(const boost::asio::ip::address &clientIp)
 {
     if (clientIp.is_v6() && clientIp.to_v6().is_v4_mapped())
     {
         return boost::asio::ip::make_address_v4(
                    boost::asio::ip::v4_mapped, clientIp.to_v6())
             .to_string();
     }
     else
     {
         return clientIp.to_string();
     }
 }

 int main()
 {
     std::vector<boost::asio::ip::address> ipAddrs = {
         boost::asio::ip::make_address("127.0.0.1"),
         boost::asio::ip::make_address("192.168.1.1"),
         boost::asio::ip::make_address("::1"),
         boost::asio::ip::make_address("fd03:f9ab:25de:89ec::0001"),
         boost::asio::ip::make_address("fd03:f9ab:25de:89ec::1234:abcd"),
         boost::asio::ip::make_address("fd03:f9ab:25de:89ec:1234:5678:90ab:cdef"),
         boost::asio::ip::make_address("::ffff:127.0.0.1")};

     for (auto & ipAddr : ipAddrs) {
         std::cout << convertIpAddr(ipAddr) << "\n";
     }

     return 0;
 }

And the result is

 127.0.0.1
 192.168.1.1
 ::1
 fd03:f9ab:25de:89ec::1
 fd03:f9ab:25de:89ec:1234:5678:90ab:cdef
 fd03:f9ab:25de:89ec::1234:abcd
 127.0.0.1

